function generateDummyTaxonomy(taxonomyName, allowedDepth, maxWidth) {
    trace("Generating dummy taxonomy...");
   
    // getting some words first
    var loremIpsum = "brake pedal gear wheels windshield torque is a device that is designed or used to transport people or cargo. Most often vehicles are manufactured, such as bicycles, cars, motorcycles, trains, ships, boats, and aircraft.Vehicles that do not travel on land often are called craft, such as watercraft, sailcraft, aircraft, hovercraft, and spacecraft.Land vehicles are classified broadly by what is used to apply steering and drive forces against the ground: wheeled, tracked, railed, or skied. ISO 3833- 1977 is the standard, also internationally used in legislation, for road vehicles types, terms and definitions";
    loremIpsum += "Before summer fun, make sure your vehicle can handle the heat. Prepare your car for trips to the beach, road trip vacations and just everyday summer driving with these helpful auto care tips. Keep your car in good running condition with easy maintenance and avoid summer roadside breakdowns.";
    loremIpsum += "In modern usage, the term is used to describe devices capable of performing mechanical work, as in the original steam engine. In most cases the work is produced by exerting a torque or linear force, which is used to operate other machinery which can generate electricity, pump water, or compress gas. In the context of propulsion systems, an air-breathing engine is one that uses atmospheric air to oxidise the fuel carried rather than supplying an independent oxidizer, as in a rocket.";
    loremIpsum += "An armoured fighting vehicle's chassis comprises the bottom part of the AFV that includes the tracks, engine, driver's seat, and crew compartment. This describes the lower hull, although common usage of might include the upper hull to mean the AFV without the turret. A chassis serves as basis for platforms on tanks, armored personnel carriers, combat engineering vehicles";
        var loremIpsum = loremIpsum.replace(/[.,]/g, "");
    var allWords =  loremIpsum.split(" ");
    var words = [];

    for (var i in allWords ) if (allWords[i].length > 4 && allWords[i]!="" && !(/\s/g.test(allWords[i]))) {
        words.push(allWords[i].substring(0,1).toUpperCase()+allWords[i].substring(1, allWords[i].length));
    }
    trace("Number of words: "+words.length);
    numberOfWords = words.length;

    // building the tree

    var currentDepth = 0;
    var _id = 0;

    var populateTree = function(baseTree) {
      
        if (typeof baseTree.id == "undefined") baseTree.id = _id;

        if (typeof baseTree.name == "undefined") {
            
            var selectedWords = [];
            var selectThisMany = Math.ceil(Math.random() * Math.random() * 3);

            for (var i = 0; i < selectThisMany; i++) {
                var pos = Math.round(numberOfWords * Math.random());
                selectedWords.push(words[pos]);
            }
            
            baseTree.name = selectedWords.join(" ");
        }

        baseTree.data = {};
        baseTree.children = [];
        baseTree.data.population = Math.round(Math.random()*40);

        _id++;
        currentDepth++;

        if (currentDepth < allowedDepth && Math.random() > 0+(currentDepth-1)/allowedDepth) {
            
            baseTree.children = [];
            var myWidth = Math.max(Math.ceil(Math.random()*maxWidth), 5); 


            for (var i = 0; i<myWidth; i++) {
                var child = populateTree({}); 
                baseTree.children.push(child);
            }
        } else {
        }
        
        currentDepth--;

        return baseTree;
    }
   
    var tree = populateTree ( {id: 'root', name: taxonomyName} );
    var treeJSON = JSON.stringify(tree);
    
    trace(treeJSON);
  //  alert(_id);
    return treeJSON;
}

